import React from 'react';
import Header from './Header';
import Description from './Description';
import Cycle from './Cycle';
import Nav from './Nav';
import { Container, Row, Col } from 'react-grid-system';
function Main() {
  return (
    <div>
    <Row>
    <Container>

      <Row>
      <Header />               
      </Row>
      <Row>
          <Col sm={8}>
              <Cycle />
          </Col>
      </Row>    
    </Container>
    </Row>
    </div>
  );
}

export default Main;
